import React, { useEffect, useState } from "react";
import { useSelector, useDispatch } from "react-redux";
import { transactionActions } from "../../Actions";
import { Table, Badge, Menu, Dropdown } from "antd";

export default function TransactionPage() {
  const transactionList = useSelector(
    (state) => state.transactions.transactionData
  );
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(transactionActions.getAllTransactions());
  }, [dispatch]);

  const columns = [
    { title: "trasaction id", dataIndex: "_id", key: "_id" },
    { title: "products", dataIndex: "productId", key: "productId" },
    { title: "Date", dataIndex: "createdAt", key: "createdAt" },
  ];

  const data = transactionList;

  return (
    <div>
      <Table
        className="components-table-demo-nested"
        columns={columns}
        dataSource={data}
      />
      <table>
        <tr>
          <thead>
            <td>trasaction id</td>
            <td>products</td>
            <td> date</td>
          </thead>
        </tr>
        {transactionList &&
          transactionList.length > 0 &&
          transactionList.map((list) => {
            return (
              <div>
                <tr>
                  <td>{list._id}</td>
                  <td>{list.productId}</td>
                  <td>{list.createdAt}</td>
                </tr>
              </div>
            );
          })}
      </table>
    </div>
  );
}
